// 引入React核心库
import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import style from './index.module.css';

import profileURL from '../../images/female.jpg';

// 创建类式组件
export default class SummaryInfo extends Component{
  render (){
    return (
      <div className={style.flexRow}>
        <img className='profile' src={profileURL} alt='头像' title='头像'/>
        <div>
          <div className='alias'>Hello</div>
          <div className='introduction'>React</div>
        </div>
      </div>
    )
  }
}
